class ApiLibrary{

    GetThumbData = async (videoCode) => {
        
        let url = `${window.location.origin}/api/video/thumb/${videoCode}`;
        console.log(url)
        let json = await (
            await fetch(url)
        );

        console.log(json)
        json = json.json();
        console.log(json)

        if (Array.isArray(json)) {
            json.forEach((item, index) => {
                return (`Item ${index}: ${item}`);
            });

        }
    };
}


export default ApiLibrary;
